// ProfilesPage.js

import React from 'react';
import defaultImage from './default.jpeg'; 
import UserProfile from './DetailedProfile';
import '../App.css'; // Import your CSS file for styling
import { Route } from 'react-router-dom';

const btnClk = () => {
  console.log("Button clicked!")
}

const ProfilesPage = () => {
  const renderProfileItems = () => {
    const profileItems = [];

    for (let i = 1; i <= 15; i++) {
      profileItems.push(
        <Router>
        <div key={i} className="portfolio-item">
          <Link to="/userprofile" onClick={btnClk}>
          <a className='buttonProfile'>
            <img src={defaultImage} alt="Default Image" />
            <span className='username'>Username {i}</span>
          </a>
          </Link>
        </div>
        </Router>
      );
    }

    return profileItems;
  };

  return (
    <div>
      <div className="container">
        <div className="portfolio-grid">{renderProfileItems()}</div>
      </div>
      <Routes>
        <Route path="/userprofile" element={<UserProfile />} />
      </Routes>
    </div>
  );
};

export default ProfilesPage;
